function playSfx(name, vol=1){

  const a=new Audio(AUDIO[name]);

}
function ensureBgm(){

  bgm=new Audio(AUDIO.bgm);

}
function shuffle(arr){
  for(let i=arr.length-1;i>0;i--){ const j=Math.floor(Math.random()*(i+1)); [arr[i],arr[j]]=[arr[j],arr[i]]; }
  return arr;
}
function makeDeck(){
  const pairs = IMAGES.flatMap((img,idx)=>[
    {key:idx+'A', name:img.name, src:img.src},
    {key:idx+'B', name:img.name, src:img.src}
  ]);
  return shuffle(pairs);
}
function cardTpl(card, idx){
  return `<div class="card">
    <button class="cardBtn flipped" data-key="${card.key}" data-name="${card.name}" aria-label="„Ç´„Éº„Éâ ${idx+1}" aria-pressed="false">
      <div class="face" aria-hidden="true"><img src="${card.src}" alt="„Ç≠„É£„É©„ÇØ„Çø„Éº"></div>
      <div class="back" aria-hidden="true"></div>
    </button>
  </div>`
}
function render(){
  const deck = makeDeck();
  $grid.innerHTML = deck.map(cardTpl).join('');
}
function resetGame(){
  first=second=null; lock=false; matches=0; moves=0; started=false; finished=false;
  timeLeft=30.0;
  $moves.textContent='üÉè 0 Êâã';
  $count.textContent='‚è≥ 00:30';
  render();
  stopTimer();
  if(bgm){ try{bgm.pause();}catch(e){} bgm=null; }
}
function formatCount(v){
  const s=Math.max(0, Math.ceil(v));
  const mm=String(Math.floor(s/60)).padStart(2,'0');
  const ss=String(s%60).padStart(2,'0');
  return mm+':'+ss;
}
function startTimer(){
  if (tId) clearInterval(tId);
  let prev = performance.now();
  tId = setInterval(()=>{
    const now = performance.now();
    const dt = (now - prev)/1000; prev = now;
    timeLeft -= dt; if(timeLeft < 0) timeLeft = 0;
    $count.textContent = '‚è≥ ' + formatCount(timeLeft);
    if(timeLeft<=0 && !finished) gameOver(false);
  }, 100);
}
function stopTimer(){ if (tId) clearInterval(tId); tId=null; }
function flip(btn){
  if (finished) return;
  if (!started) { started=true; startTimer(); ensureBgm(); }
  if (lock) return;
  if (!btn.classList.contains('flipped')) return;
  btn.classList.remove('flipped');
  btn.setAttribute('aria-pressed','true');
  playSfx('flip', .9);
  if (!first) { first = btn; return; }
  if (btn === first) return;
  second = btn;
  moves++; $moves.textContent='üÉè '+moves+' Êâã';
  check();
}
function check(){
  const isMatch = first.dataset.name === second.dataset.name;
  if (isMatch) {
    matches++;
    first.classList.add('matched'); second.classList.add('matched');
    playSfx('match', .9);
    first = second = null;
    if (matches === IMAGES.length) gameOver(true);
  } else {
    lock = true; playSfx('miss', .8);
    setTimeout(()=>{
      first.classList.add('flipped'); second.classList.add('flipped');
      first.setAttribute('aria-pressed','false'); second.setAttribute('aria-pressed','false');
      first = second = null; lock = false;
    }, 650);
  }
}
function gameOver(cleared){
  finished = true; stopTimer();
  if (bgm) { try{bgm.pause();}catch(e){} }
  if (cleared) {
    playSfx('win', 1);
    $resTitle.textContent='„Éü„ÉÉ„Ç∑„Éß„É≥ÈÅîÊàêÔºÅ ÂêàË®ÄËëâÔºúÊù±Êàê100Âë®Âπ¥Ôºû';
    const remain = formatCount(timeLeft);
    $resText.textContent=`ÊÆã„ÇäÊôÇÈñìÔºö${remain}„ÄÄÊâãÊï∞Ôºö${moves}`;
  } else {
    playSfx('timeup', 1);
    $resTitle.textContent='ÊôÇÈñìÂàá„ÇåÔºÅ';
    $resText.textContent=`ÂÖ®ÈÉ®Ë¶ã„Å§„Åë„ÇãÂâç„Å´ÊôÇÈñì„Åå0„Å´„Å™„Çä„Åæ„Åó„Åü„ÄÇÊâãÊï∞Ôºö${moves}`;
  }
  $overlay.classList.add('active');
}
document.addEventListener('click',(e)=>{ const btn=e.target.closest('.cardBtn'); if(btn) flip(btn); });
document.getElementById('resetBtn').addEventListener('click',()=>{ $overlay.classList.remove('active'); resetGame(); });
document.getElementById('againBtn').addEventListener('click',()=>{ $overlay.classList.remove('active'); resetGame(); });
document.getElementById('closeBtn').addEventListener('click',()=>{ $overlay.classList.remove('active'); });
$muteBtn.addEventListener('click',()=>{
  muted=!muted; $muteBtn.textContent = muted ? 'üîá Èü≥OFF' : 'üîä Èü≥ON';
  $muteBtn.classList.toggle('muted', muted);
  if (muted && bgm) { try{bgm.pause();}catch(e){} }
});
resetGame();
</script>
